import React from "react";
import styled from "styled-components";

const PostDetail = (props) => {
  return (
    <React.Fragment>
        <Liner placeholder="글제목"/>
        <Liner placeholder="글쓴이"/>
    </React.Fragment>
  );
};

const Liner = styled.div`
  margin: 100px;
  padding: 10px;
  border-bottom: 2px solid grey;
  display: block;
  text-align: center;
`;
export default PostDetail;
